Cryptos-Outlook
Layer 1 and Layer 2
@eigenlayer launched its mainnet together with its incubated@eigen_da. Restakers can now delegate their restaked $ETH to the AVS Operator of their choice. The mainnet is at beta stage, which doesn't include functions like payments from AVSs to operators and slashing.@OmniFDN, an AVS interoperability network that is designed to connect Ethereum rollups to achieve unified operating system, announced to airdrop 13.3% of its token allocation to EigenLayer restakers, demonstrated the potential supplementary return in restaking. Omni Network is part of the Binance Launchpool program.
